import React, { Component } from 'react';

import Grid from '@material-ui/core/Grid';
import Card from '@material-ui/core/Card';


class Dashboard extends Component {
    render() {
        return (
            <Grid
                container
                direction="row"
                justify="center"
                alignItems="center"
            >
                 <Card style={{width: 300}}>
                 <p> TESTE </p>
                 </Card>
            </Grid>
        )
    }
}

export default Dashboard
